import React from "react";
import { TopNav, NavLink }
 from "./Navbar";
import waterlogo from "../assets/water-logo.mp4";



const Navbar = () => {

const aboutpg = document.getElementById("about");
const workexperiencepg = () => document.getElementById("work");
const educationpg = () => document.getElementById("education");
const skillspg = () => document.getElementById("skills");
const projectspg = () => document.getElementById("projects");
const contactpg = () => document.getElementById("contact");


return (
 <TopNav>

 <video src= {waterlogo} autoPlay loop muted className="lg:p-[.5rem] lg:mb-2 lg:w-[30vh] lg:a w-[0px]"/>

  <NavLink to="/about " onClick={aboutpg.scrollIntoView({behavior: "smooth"})}  activeStyle>
   About
  </NavLink>
  <NavLink to="/workexperience" onClick={() =>{workexperiencepg.scrollIntoView()}} activeStyle>
   Work Experience
  </NavLink>
  <NavLink to="/education" onClick={() =>{educationpg.scrollIntoView()}} activeStyle>
   Education
  </NavLink>
  <NavLink to="/skills" onClick={() =>{skillspg.scrollIntoView()}} activeStyle>
   Skills
  </NavLink>
  <NavLink to="/projects&activities" onClick={() =>{projectspg.scrollIntoView()}} activeStyle>
   Projects and Activities
  </NavLink>
  <NavLink className ="lg:mb-36" to="/contact" onClick={() =>{contactpg.scrollIntoView()}} activeStyle>
   Contact
  </NavLink>

 </TopNav>
);
}

export default Navbar ;
